/* ─── PROGRESS BAR ────────────────────────────────────────────────────── */
const ScrollProgress = () => {
  const [progress, setProgress] = useState(0);
  useEffect(() => {
    const onScroll = () => {
      const doc = document.documentElement;
      const total = doc.scrollHeight - doc.clientHeight;
      setProgress(total ? (window.scrollY / total) * 100 : 0);
    };
    window.addEventListener("scroll", onScroll);
    return () => window.removeEventListener("scroll", onScroll);
  }, []);
  return (
    <div style={{ position: "fixed", top: 0, left: 0, right: 0, height: 2, zIndex: 1000, background: "transparent" }}>
      <div style={{ height: "100%", background: "linear-gradient(90deg, var(--accent), var(--accent2))", width: `${progress}%`, transition: "width 0.1s ease" }} />
    </div>
  );
};

